/*
Contain information to render left menu,
including name (label), redirect link(url), and icon name(icon)

Contain information to render right menu,
including name (label) and redirect link(url)
*/

const BASE_URL = '/';

const navItems = [
    {
      label: 'Home',
      url: BASE_URL,
      icon: 'Home'

    },
    {
      label: 'Colors',
      url: BASE_URL + 'colors',
      icon: 'Palette'

    },
    {
      label: 'Components',
      url: BASE_URL + 'components',
      icon: 'Widgets',
      subNavItems: [
        {
          label: 'Avatar',
          url: BASE_URL + 'components/avatar',
          icon: 'NavigateNext'

        },
        {
          label: 'Button',
          url: BASE_URL + 'components/button',
          icon: 'NavigateNext'

        },
        {
          label: 'Chips',
          url: BASE_URL + 'components/chips',
          icon: 'NavigateNext'
        },
      ]
    },
    {
      label: 'Charts',
      url: BASE_URL + 'charts',
      icon: 'Timeline',
      subNavItems: [
        {
          label: 'Pie',
          url: BASE_URL + 'charts/pie',
          icon: 'NavigateNext'

        },
        {
          label: 'Vertical Bar',
          url: BASE_URL + 'charts/verticalbar',
          icon: 'NavigateNext'
        },
      ]
    },
    {
      label: 'Icons',
      url: BASE_URL + 'icons',
      icon: 'BlurOn'

    }
];

const rightMenu = [
  {
    label: 'Material-UI',
    link: 'https://material-ui.com/'
  },
  {
    label: 'React',
    link: 'https://reactjs.org/'
  },
  {
    label: 'React-Vis',
    link: 'https://github.com/uber/react-vis'
  },
];


export default {navItems,rightMenu}
